/* eslint-disable import/prefer-default-export */
export const GetAccount = async id_cliente => {

    const requestOptions = {
		method: 'POST',
		headers: {
			'Content-Type': 'application/json'
		},
		body: JSON.stringify({idcliente: id_cliente})
	};

	const resp = await fetch(`https://fl8vvup0y0.execute-api.us-east-1.amazonaws.com/dev/getaccount`, requestOptions);
	const sku = await resp.json();

	console.log('perro', sku);
	return sku;
};
